class Solution:
    #   Time Limit Exceeded
    def fourSumCount0(self, A, B, C, D):
        if A is None or 0 == len(A) or B is None or 0 == len(B) or C is None or 0 == len(C) or D is None or 0 == len(D):
            return 0
        N, abSumDict, cdSumDict = len(A), {}, {}
        for i in range(N):
            for j in range(N):
                abSum = A[i] + B[j]
                if abSum in abSumDict:
                    abSumDict[abSum].append((i, j))
                else:
                    abSumDict[abSum] = [(i, j)]
                cdSum = C[i] + D[j]
                if cdSum in cdSumDict:
                    cdSumDict[cdSum].append((i, j))
                else:
                    cdSumDict[cdSum] = [(i, j)]

        result = 0
        for abSum, ijList in abSumDict.items():
            if -abSum in cdSumDict:
                result += len(ijList) * len(cdSumDict[-abSum])
        return result

    #   38.28%
    def fourSumCount(self, A, B, C, D):
        if A is None or 0 == len(A) or B is None or 0 == len(B) or C is None or 0 == len(C) or D is None or 0 == len(D):
            return 0
        N, abSumDict, cdSumDict = len(A), {}, {}
        for i in range(N):
            for j in range(N):
                abSum = A[i] + B[j]
                if abSum in abSumDict:
                    abSumDict[abSum] += 1
                else:
                    abSumDict[abSum] = 1
                cdSum = C[i] + D[j]
                if cdSum in cdSumDict:
                    cdSumDict[cdSum] += 1
                else:
                    cdSumDict[cdSum] = 1

        result = 0
        for abSum, ijListCnt in abSumDict.items():
            if -abSum in cdSumDict:
                result += ijListCnt * cdSumDict[-abSum]
        return result


